import React, { useEffect, useState } from "react";
import {
  Container,
  Typography,
  Card,
  CardMedia,
  CardContent,
  IconButton,
  Button,
  Box
} from "@mui/material";
import DeleteIcon from "@mui/icons-material/Delete";
import AddIcon from "@mui/icons-material/Add";
import RemoveIcon from "@mui/icons-material/Remove";
import { Link } from "react-router-dom";

function Cart() {
  const [cart, setCart] = useState([]);
  const [total, setTotal] = useState(0);

  // ðŸ“Œ Cargar carrito desde localStorage
  useEffect(() => {
    const savedCart = JSON.parse(localStorage.getItem("cart")) || [];
    setCart(savedCart);
  }, []);

  // ðŸ“Œ Recalcular total cada vez que cambie el carrito
  useEffect(() => {
    const totalPrice = cart.reduce((sum, item) => sum + item.price * item.quantity, 0);
    setTotal(totalPrice);
  }, [cart]);

  // ðŸ“Œ Aumentar cantidad
  const increaseQuantity = (index) => {
    const updatedCart = [...cart];
    updatedCart[index].quantity += 1;
    setCart(updatedCart);
    localStorage.setItem("cart", JSON.stringify(updatedCart));
  };

  // ðŸ“Œ Disminuir cantidad
  const decreaseQuantity = (index) => {
    const updatedCart = [...cart];
    if (updatedCart[index].quantity > 1) {
      updatedCart[index].quantity -= 1;
    }
    setCart(updatedCart);
    localStorage.setItem("cart", JSON.stringify(updatedCart));
  };

  // ðŸ“Œ Eliminar producto
  const removeItem = (index) => {
    const updatedCart = cart.filter((_, i) => i !== index);
    setCart(updatedCart);
    localStorage.setItem("cart", JSON.stringify(updatedCart));
  };

  return (
    <Container sx={{ mt: 4 }}>
      <Typography variant="h4" gutterBottom>
        ðŸ›’ Carrito de Compras
      </Typography>

      {cart.length === 0 ? (
        <Typography variant="h6">Tu carrito estÃ¡ vacÃ­o</Typography>
      ) : (
        <>
          {cart.map((item, index) => (
            <Card
              key={index}
              sx={{
                display: "flex",
                alignItems: "center",
                mb: 2,
                p: 1,
                boxShadow: 2
              }}
            >
              <CardMedia
                component="img"
                sx={{ width: 120, height: 120, objectFit: "cover" }}
                image={item.image}
                alt={item.name}
              />
              <CardContent sx={{ flexGrow: 1 }}>
                <Typography variant="h6">{item.name}</Typography>
                <Typography variant="body1">Precio: S/ {item.price}</Typography>
                <Box sx={{ display: "flex", alignItems: "center", mt: 1 }}>
                  <Typography variant="body2" sx={{ mr: 1 }}>
                    Cantidad:
                  </Typography>
                  <IconButton onClick={() => decreaseQuantity(index)} size="small">
                    <RemoveIcon />
                  </IconButton>
                  <Typography variant="body1" sx={{ mx: 1 }}>
                    {item.quantity}
                  </Typography>
                  <IconButton onClick={() => increaseQuantity(index)} size="small">
                    <AddIcon />
                  </IconButton>
                  <IconButton onClick={() => removeItem(index)} color="error">
                    <DeleteIcon />
                  </IconButton>
                </Box>
              </CardContent>
            </Card>
          ))}

          {/* Total */}
          <Box
            sx={{
              display: "flex",
              justifyContent: "space-between",
              mt: 3,
              fontWeight: "bold",
              fontSize: "18px"
            }}
          >
            <Typography>Total: S/ {total.toFixed(2)}</Typography>
            <Button
              variant="contained"
              color="primary"
              component={Link}
              to="/checkout"
            >
              Proceder al pago
            </Button>
          </Box>
        </>
      )}
    </Container>
  );
}

export default Cart;
